const login = async (cb) => {
  const { user } = await firebase.auth().signInAnonymously();

  const unsubscribe = firebase
    .auth()
    .onAuthStateChanged((user) => {
      const shouldRestart = !user;

      if (shouldRestart) {
        unsubscribe();
      }

      cb(shouldRestart);
    });

  return user.uid
};

